/*--------- MODAL VIDEO AREA STYLES ---------*/
.modal-video-area{
    margin: 3rem 0;
  }
  
  .modal{
      z-index: 999999;
  }
  
  .modal-dialog {
    max-width: 800px;
    margin: 80px auto;
  }
  
  .modal-body {
    position:relative;
    padding:0px;

  }
  
  .close {
    position:absolute;
    right:-30px;
    top:0;
    z-index:999;
    font-size:2rem;
    font-weight: normal;
    color:#fff;
    opacity:1;
       transition: 0.2s ease; 
  }
  
  .close:not(:disabled):not(.disabled):focus, .close:not(:disabled):not(.disabled):hover {
      color: #fff;
      text-decoration: none;
      opacity: .75;
  }
  
  button.close {
      padding: 0px 4px 5px 4px;
      background-color: #0088ce;
        transition: 0.2s ease;
  }
  
  .v-link-img{
       border: 0;
