.card {
    padding: 30px;
    width: 20%;
    margin: 15px;
    float: left;
    border: none;

    position: relative;
    @media (min-width: 800px) {
       max-width: calc(33% - 30px);
    }
    .card__illustration {
      width:50px;
      height:50px;
      background: grey;
      border-radius: 50%;
      margin: auto
    }
    .card__title {
      text-align: center;
    }
    .more-container {
      display: none;
    }
    &.active {
      &:after {
        content: '';
        display: block;
        background: #eaeaea;
        position: absolute;
        bottom: -30px;
        left: 50%;
        transform: translateX(-50%);
        width: 30px;
        height: 30px;
      }
    }
  }
  
  //More container
  .more-container {
    border-radius: 5px;
    background: #eaeaea;
    padding: 30px;
    float: left;
      width: 100%;
    position: relative;
    //Layout
    .more-container__col-left {
      width: 33%;
      float: left;
      text-align: center;
    }
    .more-container__col-right {
      width: 66%;
      float: right;
    }
    //Components
    .more-container__control-btn {
      position: absolute;
      top: 30px;
      right: 30px;
      .btn {
        background: transparent;
        border: none;
      }
    }
    .more-container__illustration {
      width: 150px;
      height: 150px;
      background: grey;
      border-radius: 50%;
      margin: auto;
    }
    .more-container__cta {
      margin-top: 30px;
      width: 150px;
    }
    .more-container__description {
      max-width: 600px;
    }
  }
